INSERT INTO `news` (`id`, `name`, `description`, `content`, `hot`, `photo`, `createdate`, `createdby`, `roleaccept`) VALUES
(8, 'THÔNG BÁO CHÍNH THỨC TỪ CÔNG TY CỔ PHẦN TIN HỌC VIẾT SƠN', '<h3>TH&Ocirc;NG B&Aacute;O CH&Iacute;NH THỨC TỪ C&Ocirc;NG TY CỔ PHẦN TIN HỌC VIẾT SƠN</h3>\r\n\r\n<div class=\"eJOY__extension_root_class\" id=\"eJOY__extension_root\" style=\"all:unset\">&nbsp;</div>\r\n', '<p>Kể từ ng&agrave;y 25/07/2024, tập đo&agrave;n Achieva Technology SDN BHD ch&iacute;nh thức trở th&agrave;nh Nh&agrave; Ph&acirc;n Phối khu vực của Intel ( Intel Authorized Distributor) tại thị trường Việt Nam.</p>\r\n\r\n<p>Được sự ủy th&aacute;c v&agrave; t&iacute;n nhiệm từ tập đo&agrave;n Achieva:</p>\r\n\r\n<p>C&ocirc;ng Ty Cổ Phần Tin Học Viết Sơn ch&iacute;nh thức trở th&agrave;nh đối t&aacute;c đại diện , với mục ti&ecirc;u th&uacute;c đẩy hoạt động kinh doanh v&agrave; ph&acirc;n phối sản phẩm Intel tại thị trường Việt Nam.</p>\r\n\r\n<p>Ch&uacute;ng t&ocirc;i cam kết sẽ lu&ocirc;n mang lại những gi&aacute; trị tốt nhất cho tất cả Qu&yacute; đối t&aacute;c kinh doanh cũng như Qu&yacute; Kh&aacute;ch H&agrave;ng đ&atilde; lựa chọn sản phẩm Intel v&agrave; C&ocirc;ng ty Viết Sơn</p>\r\n\r\n<p><a href=\"https://www.facebook.com/hashtag/vietson?__eep__=6&amp;__cft__[0]=AZWHd4QA6q8JOjGDPwfBCFdaoc0H3T2u9heWTUHOxrbxYiRwblGL8r9rTp-TUli0np2O46pMn4CWQLT2x3NnSjB9RFOqGCTOOg2TcQ9xStdklZOdY7FWH7Ql2R5h1fRx0VULuBSp2zE9YTogl15LGsDsBBITjssRz7GxU2ZoJPUBDgmLlOL1VIVEGb2C4YcGUZtyvRFTg7OkG4w_ys56mwCe&amp;__tn__=*NK-R\" tabindex=\"0\">#Vietson</a> <a href=\"https://www.facebook.com/hashtag/intel?__eep__=6&amp;__cft__[0]=AZWHd4QA6q8JOjGDPwfBCFdaoc0H3T2u9heWTUHOxrbxYiRwblGL8r9rTp-TUli0np2O46pMn4CWQLT2x3NnSjB9RFOqGCTOOg2TcQ9xStdklZOdY7FWH7Ql2R5h1fRx0VULuBSp2zE9YTogl15LGsDsBBITjssRz7GxU2ZoJPUBDgmLlOL1VIVEGb2C4YcGUZtyvRFTg7OkG4w_ys56mwCe&amp;__tn__=*NK-R\" tabindex=\"0\">#Intel</a></p>\r\n\r\n<p>--------------------------------------------------------</p>\r\n\r\n<p>VIẾT SƠN - Leading Distributor in the Internet of Every things</p>\r\n\r\n<p><img alt=\"????\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tf6/1/16/1f3e0.png\" style=\"height:16px; width:16px\" /> 150Ter B&ugrave;i Thị Xu&acirc;n, P. Phạm Ngũ L&atilde;o, Q.1, TP.HCM</p>\r\n\r\n<p><img alt=\"????\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tf6/1/16/1f3e0.png\" style=\"height:16px; width:16px\" /> Chi nh&aacute;nh HN : tầng 4, số 1 Th&aacute;i H&agrave;- Trung Liệt, Đống Đa, H&agrave; Nội.</p>\r\n\r\n<p><a href=\"https://www.facebook.com/photo/?fbid=1021460069985838&amp;set=a.141762194622301&amp;__cft__[0]=AZWHd4QA6q8JOjGDPwfBCFdaoc0H3T2u9heWTUHOxrbxYiRwblGL8r9rTp-TUli0np2O46pMn4CWQLT2x3NnSjB9RFOqGCTOOg2TcQ9xStdklZOdY7FWH7Ql2R5h1fRx0VULuBSp2zE9YTogl15LGsDsBBITjssRz7GxU2ZoJPUBDgmLlOL1VIVEGb2C4YcGUZtyvRFTg7OkG4w_ys56mwCe&amp;__tn__=EH-R\" tabindex=\"0\"><img alt=\"Có thể là hình ảnh về văn bản\" src=\"https://scontent.fhan4-6.fna.fbcdn.net/v/t39.30808-6/453000284_1021460076652504_1710201677167281549_n.jpg?stp=dst-jpg_s600x600&amp;_nc_cat=109&amp;ccb=1-7&amp;_nc_sid=127cfc&amp;_nc_ohc=vw0J52Qc9ZEQ7kNvgFB1dOf&amp;_nc_ht=scontent.fhan4-6.fna&amp;oh=00_AYDuPbXFBcOphb4kGEn8778nuPCcDajuuGg5bjQVpk8VZg&amp;oe=66D31248\" style=\"height:503px; width:600px\" /></a></p>\r\n\r\n<div class=\"eJOY__extension_root_class\" id=\"eJOY__extension_root\" style=\"all:unset\">&nbsp;</div>\r\n', 1, '1724731817_on6.jpg', '2023-05-04', 1, 1);
