INSERT INTO `products` (`id`, `name`, `description`, `config`, `content`, `hot`, `photo`, `price`, `discount`, `category_id`, `createdate`, `view`) VALUES
(1, 'Bộ máy Asus', '<ul>\r\n	<li>Card m&agrave;n h&igrave;nh Asus TUF RTX3090-O24G-GAMING l&agrave; một trong những sản phẩm cao cấp nhất của Asus phục vụ cho nhu cầu gaming ở độ ph&acirc;n giải 8K 60FPS. Đ&acirc;y l&agrave; card đồ họa sử dụng kiến tr&uacute;c Ampare ho&agrave;n to&agrave;n mới c&ugrave;ng nh&acirc;n RT thế hệ 2, nh&acirc;n Tensor thế hệ 3, Nvidia RTX IO, VRAM GDDR6X v&agrave; sản xuất tr&ecirc;n tiến tr&igrave;nh 8nm được Samsung l&agrave;m ri&ecirc;ng.</li>\r\n</ul>\r\n\r\n<div class=\"eJOY__extension_root_class\" id=\"eJOY__extension_root\" style=\"all:unset\">&nbsp;</div>\r\n', '<p>Số nhân /luồng 	 4/8\nBase Clock	3.7 GHz\nTurbo Boost Clock 	4.4 GHz\nCache 	6MB\nTiến trình sản xuất 	14 nm\nPhiên bản PCI Express	4.0\nSố lane PCI Express	20\nTDP	65W\nHỗ trợ số kênh bộ nhớ	2\nSocket	LGA 1200\nTên thế hệ	Rocket Lake\nĐồ họa tích hợp	Không\nSiêu phân luồng	Có\n</p>', '<h3>Đổi mới to&agrave;n diện&nbsp;</h3>\r\n\r\n<p>Từ tr&ecirc;n xuống dưới, Card m&agrave;n h&igrave;nh Asus TUF RTX3090-O24G-GAMING đ&atilde; được cải tiến ho&agrave;n to&agrave;n để ph&ugrave; hợp với nền tảng Ampere ho&agrave;n to&agrave;n mới từ NVIDIA để mang đến&nbsp; hiệu suất chơi game vượt trội so với thế hệ trước. D&ograve;ng card đồ họa TUF mang một thiết kế mới v&agrave; nhiều kim loại hơn bao quanh 3 quạt l&agrave;m m&aacute;t với c&ocirc;ng nghệ Axial. C&aacute;ch bố tr&iacute; tất cả c&aacute;c quạt xoay c&ugrave;ng 1 hướng đ&atilde; lỗi thời, ở thế hệ mới nhất 3 quạt tr&ecirc;n d&ograve;ng&nbsp;card đồ họa&nbsp;TUF được ph&acirc;n l&agrave;m 2 nhiệm vụ quạt ch&iacute;nh v&agrave; phụ trợ quay đảo chiều nhau đem lại hiệu suất tốt hơn hẳn. B&ecirc;n dưới c&aacute;c c&aacute;nh quạt, một bộ tản nhiệt lớn hơn, ấn tượng hơn đ&atilde; sẵn s&agrave;ng cho c&aacute;c mức nhiệt độ &quot;khủng&quot; nhất.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Quạt l&agrave;m m&aacute;t c&ocirc;ng nghệ Axial</strong></h3>\r\n\r\n<p>C&ocirc;ng nghệ Axial gi&uacute;p bố tr&iacute; quạt l&agrave;m m&aacute;t tối ưu hơn cho c&aacute;c bộ tản nhiệt k&iacute;ch thước lớn. Số lượng c&aacute;nh quạt cũng được tăng l&ecirc;n với 13 cho quạt trung t&acirc;m v&agrave; 11 cho 2 quạt c&ograve;n lại. Phần v&ograve;ng chắn của 2 quạt b&ecirc;n được thiết kế dạng răng cưa mỏng cho ph&eacute;p lấy được th&ecirc;m lượng gi&oacute; từ hai b&ecirc;n, trong khi đ&oacute; quạt trung t&acirc;m với k&iacute;ch thước lớn hơn phụ tr&aacute;ch nhiệm vụ gia tăng &aacute;p lực của gi&oacute; xuống bộ tản nhiệt kim loại.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>C&aacute;c c&aacute;nh quạt quay đảo chiều&nbsp;</strong></h3>\r\n\r\n<p>Thay v&igrave; cả 3 quạt đều vận h&agrave;nh theo chiều kim đồng hồ như truyền thống, giờ đ&acirc;y quạt trung t&acirc;m sẽ quay ngược chiều so với 2 quạt c&ograve;n lại để đảm bảo to&agrave;n bộ phần heatsink sẽ được l&agrave;m m&aacute;t đều, qua đ&oacute; tăng được hiệu quả l&agrave;m m&aacute;t tổng thể cho to&agrave;n bộ VGA.&nbsp;</p>\r\n\r\n<p><img alt=\"Card màn hình Asus TUF-RTX3080-10G-GAMING\" src=\"https://www.hanoicomputer.vn/media/lib/07-09-2020/1.gif\" style=\"width:100%\" /></p>\r\n\r\n<p>C&ocirc;ng nghệ của Asus c&ograve;n cho ph&eacute;p c&aacute;c c&aacute;nh quạt tự ngừng quay khi nhiệt độ của VGA được giữ ở dưới mức 55 độ C, mục đ&iacute;ch vừa giảm được tiếng ồn, vừa giữ được hiệu năng l&agrave;m m&aacute;t tối đa.&nbsp;</p>\r\n\r\n<h3><strong>Bề mặt tiếp x&uacute;c ho&agrave;n thiện đỉnh cao ở mức độ vi m&ocirc;</strong></h3>\r\n\r\n<p>Để dẫn nhiệt hiệu quả hơn, phần tiếp x&uacute;c giữa GPU v&agrave; heatsink được l&agrave;m si&ecirc;u mịn để gia tăng từng nanomet tiếp x&uacute;c qua đ&oacute; gi&uacute;p truyền dẫn nhiệt hiệu quả.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Gia tăng k&iacute;ch thước tản nhiệt</strong></h3>\r\n\r\n<p>Bộ heatsink tr&ecirc;n card đồ họa thế hệ mới của Asus d&agrave;y đến 2,9 slot PCI. Việc tăng k&iacute;ch thước tản nhiệt so với thế hệ trước cung cấp nhiều kh&ocirc;ng gian tản nhiệt hơn gi&uacute;p chipset hoạt động ở mức hiệu năng cao hơn.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Linh kiện cao cấp</strong></h3>\r\n\r\n<p>To&agrave;n bộ linh kiện tr&ecirc;n c&aacute;c d&ograve;ng sản phẩm cao cấp của Asus đều được sử dụng linh kiện c&oacute; sự chọn lọc kỹ c&agrave;ng ở cả kh&iacute;a cạnh hiệu năng lẫn độ bền.&nbsp;</p>\r\n\r\n<p><img alt=\"Card màn hình Asus TUF-RTX3080-10G-GAMING\" src=\"https://www.hanoicomputer.vn/media/lib/07-09-2020/img_components_hover.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>T&iacute;ch hợp đ&egrave;n LED RGB bắt mắt c&oacute; thể t&ugrave;y chỉnh</strong></h3>\r\n\r\n<p>Phần th&acirc;n của VGA giờ đ&acirc;y được t&iacute;ch hợp dải đ&egrave;n LED bắt mắt v&agrave; tinh tế. Chủ nh&acirc;n của mỗi chiếc VGA c&oacute; thể t&ugrave;y &yacute; s&aacute;ng tạo với phần mềm Armoury Crate.&nbsp;</p>\r\n\r\n<p><img alt=\"Card màn hình Asus TUF-RTX3080-10G-GAMING\" src=\"https://www.hanoicomputer.vn/media/lib/07-09-2020/tuf-rtx-3k-rgb.gif\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Bứt ph&aacute; hiệu năng dễ d&agrave;ng với GPU Tweak&nbsp;</strong></h3>\r\n\r\n<p>Tiện &iacute;ch ASUS GPU Tweak II đưa việc điều chỉnh cạc đồ họa l&ecirc;n một tầm cao mới. N&oacute; cho ph&eacute;p bạn điều chỉnh c&aacute;c th&ocirc;ng số quan trọng bao gồm tốc độ của GPU, bộ nhớ v&agrave; c&agrave;i đặt điện &aacute;p, với t&ugrave;y chọn gi&aacute;m s&aacute;t mọi th&agrave;nh phần trong thời gian thực. Điều khiển quạt n&acirc;ng cao cũng được t&iacute;ch hợp với nhiều t&iacute;nh năng kh&aacute;c để gi&uacute;p bạn tận dụng tối đa card đồ họa của m&igrave;nh.<img alt=\"Card màn hình Asus TUF-RTX3080-10G-GAMING\" src=\"https://www.hanoicomputer.vn/media/lib/07-09-2020/img_gpu-tweak2x.png\" style=\"width:100%\" /></p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Model</td>\r\n			<td>VGA-ASUS TUF-RTX3090-O24G-GAMING</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Engine đồ họa</td>\r\n			<td>NVDIA GEFORCE RTX3090</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Bus</td>\r\n			<td>PCI Express 4.0</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Bộ nhớ</td>\r\n			<td>24GB GDDR6X</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Engine Clock</td>\r\n			<td>OC mode : 1770 MHz (Boost Clock)<br />\r\n			Gaming mode : 1740 MHz (Boost Clock<br />\r\n			OC mode : 1770 MHz (Boost Clock)<br />\r\n			Gaming mode : 1740 MHz (Boost Clock)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>CUDA Cores</td>\r\n			<td>10496</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Độ ph&acirc;n giải</td>\r\n			<td>Độ ph&acirc;n giải Kỹ thuật Số Tối đa 7680 x 4320</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Kết nối</td>\r\n			<td>2 x HDMI 2.1,&nbsp;3 x Displayport 1.4a</td>\r\n		</tr>\r\n		<tr>\r\n			<td>K&iacute;ch thước</td>\r\n			<td>29.99 x 12.69 x 5.17 (cm)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>PSU đề nghị</td>\r\n			<td>850 W</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Power Connectors</td>\r\n			<td>2 x 8-pin</td>\r\n		</tr>\r\n		<tr>\r\n			<td>DirectX</td>\r\n			<td>12</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<div class=\"eJOY__extension_root_class\" id=\"eJOY__extension_root\" style=\"all:unset\">&nbsp;</div>\r\n', 0, '1723997719_name (33).jpg', 0, 0, 1, '2022-11-29', 6),
(2, 'Máy tính xách tay chuyên nghiệp siêu mỏng Intel® Core™ Ultra 7-155H ', '<ul>\r\n	<li>&bull; Phi&ecirc;n bản Intel&reg; Evo&trade; được trang bị bộ xử l&yacute; Intel&reg; Core&trade; Ultra 7 l&ecirc;n đến 155H</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n', '\r\nCPU AMD Ryzen 5 5500GT\r\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<ul>\r\n	<li>&bull; Phi&ecirc;n bản Intel&reg; Evo&trade; được trang bị bộ xử l&yacute; Intel&reg; Core&trade; Ultra 7 l&ecirc;n đến 155H</li>\r\n	<li>&bull; Windows 11 Home (MSI khuyến nghị sử dụng Windows 11 Pro cho doanh nghiệp.)</li>\r\n	<li>&bull; Đồ họa Intel&reg; Arc</li>\r\n	<li>&bull; M&agrave;n h&igrave;nh 16&quot; QHD+ (2560 x 1600), 16:10, 100% DCI-P3 (Điển h&igrave;nh), 400nits (Điển h&igrave;nh), Tấm nền IPS-Level</li>\r\n	<li>&bull; Lưu trữ: 1TB NVMe SSD</li>\r\n	<li>&bull; Bộ nhớ trong: 32GB</li>\r\n	<li>&bull; Pin 99,9 Whr</li>\r\n	<li>&bull; Si&ecirc;u nhẹ 3,31lbs, Si&ecirc;u mỏng 0,75in</li>\r\n	<li>&bull; Hỗ trợ Wi-Fi 7</li>\r\n	<li>&bull; Chống in dấu v&acirc;n tay với Khung hợp kim nh&ocirc;m-magi&ecirc;</li>\r\n	<li>&bull; Hỗ trợ sạc USB PD 3.0 (Power Delivery)</li>\r\n</ul>\r\n', 0, '1723998123_name (10).png', 0, 0, 6, '2022-12-29', 0),
(3, 'MÁY BỘ ROSA A4350G', '<p>Với 8GB Ram 3200MHz, v&agrave; AMD Ryzen 3 PRO 4350G mạnh mẽ m&aacute;y bạn đ&atilde; đ&aacute;p ứng hầu hết c&aacute;c nhu cầu văn ph&ograve;ng v&agrave; khả năng giải tr&iacute; với c&aacute;c tựa game như LMHT c&ugrave;ng một số game online kh&aacute;c</p>\r\n', '\r\nCPU AMD Ryzen 5 5500GT\r\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>CPU AMD Ryzen 3 PRO 4350G</strong>\r\n			<p><strong>CPU AMD Ryzen 3 PRO 4350G</strong>&nbsp;l&agrave; d&ograve;ng APU phổ th&ocirc;ng mới nhất của AMD dựa tr&ecirc;n kiến tr&uacute;c Zen 3. CPU n&agrave;y c&oacute; nh&acirc;n đồ họa t&iacute;ch hợp Radeon c&oacute; khả năng chơi tốt nhiều tựa game ở mức thiết lập cơ bản.</p>\r\n\r\n			<p>.</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>\r\n			<h3>Kiến Tr&uacute;c &#39;&#39;Zen 3&#39;&#39;&nbsp;</h3>\r\n\r\n			<p>&quot;Zen 3&quot; được cải tiến lại về thiết kế để mang đến hiệu suất tối ưu so với c&aacute;c thế hệ &#39;&#39; Zen &#39;&#39; trước, thể hiện sự tập trung kh&ocirc;ng ngừng của AMD v&agrave;o hiệu suất xử l&yacute; đơn nh&acirc;n, tiết kiệm năng lượng v&agrave; giảm độ trễ.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Hiệu suất bộ nhớ</strong>\r\n\r\n			<p><strong>&nbsp;ROSA A4350G&nbsp;</strong>trang bị bộ nhớ 8GB Bus 3200&nbsp;U-DIMM với t&ugrave;y chọn n&acirc;ng cấp tối đa l&ecirc;n 64GB cung cấp hiệu suất tốt nhất để cho ra h&igrave;nh ảnh 3D tuyệt vời.</p>\r\n			</td>\r\n			<td><img alt=\"VIET SON JSC\" src=\"https://i0.wp.com/rosacomputer.com/wp-content/uploads/2023/07/a300-insanememoryperformance-mobile.webp?resize=300%2C247&amp;ssl=1\" style=\"height:247px; width:300px\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><strong>Tối ưu h&oacute;a khả năng&nbsp;</strong>\r\n			<table style=\"width:100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>Với 8GB Ram 3200MHz, v&agrave;&nbsp;<strong>AMD Ryzen 3 PRO 4350G</strong>&nbsp;mạnh mẽ m&aacute;y bạn đ&atilde; đ&aacute;p ứng hầu hết c&aacute;c nhu cầu văn ph&ograve;ng v&agrave; khả năng giải tr&iacute; với c&aacute;c tựa game như LMHT c&ugrave;ng một số game online&nbsp;kh&aacute;c.</p>\r\n\r\n						<p>&nbsp;</p>\r\n						</td>\r\n						<td>&nbsp;</td>\r\n					</tr>\r\n					<tr>\r\n						<td>CPU</td>\r\n						<td>CPU AMD Ryzen 3 PRO 4350G (3.8 GHz turbo upto 4.0GHz/6MB/4 Cores, 8 Threads/65W/Socket AM4 - SK AM4</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Mainboard</td>\r\n						<td>Mainboard - AMD A520 Express AM4 Socket: 6 x DIMM DDR4 23200/3000/2933/2800/2666MHz<br />\r\n						- 3 x PCIe x16 slot, 1 x PCIe x1 Slot<br />\r\n						- Graphics Output Options: 1 x D-Sub Port, 1 x DVI-D port, 1 xHDMI port, 1 x Display port<br />\r\n						- 4 SATA3; 1 x M.2 2280, 2260, 2242 (both SATA &amp; x4 PCIE mode); 3 x COM (1 x COM port at back panel, 2 x COM connector )<br />\r\n						- 4 x USB 3.1 port(s) (2 Rear (included 1 Type C), 8 x USB 2.0 (2 x USB 2.0 Rear, Support 6 x USB 2.0 at midboard)<br />\r\n						- Realtek Gigabit LAN</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Ram&nbsp;</td>\r\n						<td>Ram Lexar 8GB bus 3200 DDR4 Udimm</td>\r\n					</tr>\r\n					<tr>\r\n						<td>SSD</td>\r\n						<td>Ổ cứng SSD Lexar 256GB M2 PCIe Gen3 - R: 3500MB/s - W: 1300MB/s</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Keyboard+Mouse</td>\r\n						<td