(4, 'Bộ Intel', '<ul>\r\n	<li>Card m&agrave;n h&igrave;nh Asus TUF RTX3090-O24G-GAMING l&agrave; một trong những sản phẩm cao cấp nhất của Asus phục vụ cho nhu cầu gaming ở độ ph&acirc;n giải 8K 60FPS. Đ&acirc;y l&agrave; card đồ họa sử dụng kiến tr&uacute;c Ampare ho&agrave;n to&agrave;n mới c&ugrave;ng nh&acirc;n RT thế hệ 2, nh&acirc;n Tensor thế hệ 3, Nvidia RTX IO, VRAM GDDR6X v&agrave; sản xuất tr&ecirc;n tiến tr&igrave;nh 8nm được Samsung l&agrave;m ri&ecirc;ng.</li>\r\n	<li>Card m&agrave;n h&igrave;nh Asus TUF RTX3090-O24G-GAMING l&agrave; một trong những sản phẩm cao cấp nhất của Asus phục vụ cho nhu cầu gaming ở độ ph&acirc;n giải 8K 60FPS. Đ&acirc;y l&agrave; card đồ họa sử dụng kiến tr&uacute;c Ampare ho&agrave;n to&agrave;n mới c&ugrave;ng nh&acirc;n RT thế hệ 2, nh&acirc;n Tensor thế hệ 3, Nvidia RTX IO, VRAM GDDR6X v&agrave; sản xuất tr&ecirc;n tiến tr&igrave;nh 8nm được Samsung l&agrave;m ri&ecirc;ng.</li>\r\n</ul>\r\n', '\nCPU AMD Ryzen 5 5500GT\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td>H&atilde;ng&nbsp;</td>\r\n			<td>Intel</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Model</td>\r\n			<td>CPU-Pentium G6400-RH3Y</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Số nh&acirc;n /luồng&nbsp;</td>\r\n			<td>&nbsp;2/4</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Base Clock</td>\r\n			<td>4.0 GHz</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Turbo Boost Clock&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cache&nbsp;</td>\r\n			<td>4MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tiến tr&igrave;nh sản xuất&nbsp;</td>\r\n			<td>14 nm</td>\