(5, 'CPU-Pentium G6400-RH3Y', '<ul>\r\n	<li>Ổn định, vừa phải, kh&ocirc;ng cần bảo dưỡng nhiều. C&ograve;n g&igrave; tốt hơn khi văn ph&ograve;ng của bạn được trang bị những m&aacute;y t&iacute;nh sử dụng CPU Pentium?</li>\r\n</ul>\r\n', '\nCPU AMD Ryzen 5 5500GT\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<h3><strong>Pentium si&ecirc;u ph&acirc;n luồng</strong></h3>\r\n\r\n<p>Với 2 nh&acirc;n 4 luồng ngang bằng với những CPU Core i3 của năm 2017, h&atilde;y tưởng tượng c&ocirc;ng việc của bạn sẽ trơn tru như thế n&agrave;o khi n&oacute; được giải quyết tr&ecirc;n chiếc&nbsp;Intel Pentium Gold G6400.</p>\r\n\r\n<h3><strong>Phổ cập m&aacute;y t&iacute;nh đến mọi đối tượng</strong></h3>\r\n\r\n<p>Dủ ở đ&acirc;u hay l&agrave;m bất kỳ việc g&igrave;, khi đ&atilde; t&igrave;m đến hệ sinh th&aacute;i của Intel bạn sẽ lu&ocirc;n t&igrave;m được sản phẩm ph&ugrave; hợp với t&igrave;nh h&igrave;nh t&agrave;i ch&iacute;nh v&agrave; nhu cầu của m&igrave;nh. Từ học sinh sinh vi&ecirc;n đến v&ugrave;ng hải đảo xa x&ocirc;i, mọi người đều xứng đ&aacute;ng tận hưởng những gi&aacute; trị m&agrave; Intel mang lại.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Tiết kiệm điện</strong></h3>\r\n\r\n<p>Kh&ocirc;ng chỉ c&oacute; mức gi&aacute; ph&ugrave; hợp với đại bộ phận người ti&ecirc;u d&ugrave;ng, sử dụng c&aacute;c CPU Pentium c&ograve;n g&oacute;p phần v&agrave;o việc bảo vệ m&ocirc;i trường khi năng lượng của CPU n&agrave;y l&agrave; rất thấp.</p>\r\n\r\n<h3><strong>Giải quyết nhanh gọn những t&aacute;c vụ văn ph&ograve;ng</strong></h3>\r\n\r\n<p>Cần một m&aacute;y t&iacute;nh để điều h&agrave;nh m&aacute;y in, hay chỉ đơn thuần l&agrave; g&otilde; văn bản th&igrave; CPU gi&aacute; rẻ như Pentium Series l&agrave; lựa chọn th&ocirc;ng minh.</p>\r\n\r\n<h3><strong>Những mục đ&iacute;ch kh&aacute;c</strong></h3>\r\n\r\n<p>Cắm torrent, m&aacute;y phụ để ph&aacute;t video HD trong ph&ograve;ng kh&aacute;c ...vv v&agrave; vv... kh&ocirc;ng kh&oacute; để t&igrave;m ra một việc g&igrave; đ&oacute; cần phải cắm m&aacute;y 24/7 cần nhờ đến sự trợ gi&uacute;p của c&aacute;c CPU Pentium.</p>\r\n\r\n<h3><strong>Intel Pentium Gold G6400 sẽ d&agrave;nh cho ai?</strong></h3>\r\n\r\n<p>Nh&acirc;n vi&ecirc;n văn ph&ograve;ng, những người mới l&agrave;m quen với m&aacute;y t&iacute;nh hoặc lớn hơn l&agrave; c&aacute;c tổ chức, doanh nghiệp, trường học muốn trang bị những m&aacute;y t&iacute;nh phục vụ mục đ&iacute;ch giảng dạy với số lượng lớn.</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td>H&atilde;ng&nbsp;</td>\r\n			<td>Intel</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Model</td>\r\n			<td>CPU-Pentium G6400-RH3Y</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Số nh&acirc;n /luồng&nbsp;</td>\r\n			<td>&nbsp;2/4</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Base Clock</td>\r\n			<td>4.0 GHz</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Turbo Boost Clock&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cache&nbsp;</td>\r\n			<td>4MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tiến tr&igrave;nh sản xuất&nbsp;</td>\r\n			<td>14 nm</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Phi&ecirc;n bản PCI Express</td>\r\n			<td>3.0</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Số lane PCI Express</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>TDP</td>\r\n			<td>58W</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Hỗ trợ số k&ecirc;nh bộ nhớ</td>\r\n			<td>2</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Socket</td>\r\n			<td>LGA 1200</td>\r\n		</tr>\r\n		<tr>\r\n			<td>T&ecirc;n thế hệ</td>\r\n			<td>Commet Lake</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Đồ họa t&iacute;ch hợp</td>\r\n			<td>Intel UHD Graphics 630</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Si&ecirc;u ph&acirc;n luồng</td>\r\n			<td>C&oacute;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, '1723997622_1723997524_name (28).jpg', 0, 0, 6, '2023-02-22', 23),
(6, 'VGA Intel Arc A750 8GB GDDR6 21P02J00BAVGA Intel Arc A750 8GB GDDR6 21P02J00BA', '<p>VGA Intel Arc A750 8GB GDDR6 21P02J00BAVGA Intel Arc A750 8GB GDDR6 21P02J00BA</p>\r\n', '\r\nCPU AMD Ryzen 5 5500GT\r\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<ul>\r\n	<li>VGA Intel Arc A750 8GB GDDR6&nbsp;được x&acirc;y dựng tr&ecirc;n&nbsp;tiến tr&igrave;nh&nbsp;6nm của TSMC với kiến tr&uacute;c đồ họa Xe HPG&nbsp;hỗ trợ&nbsp;khả năng Ray Tracing mạnh mẽ để n&acirc;ng cao trải nghiệm chơi game v&agrave; s&aacute;ng tạo của bạn.</li>\r\n	<li>VGA Intel Arc A750 8GB GDDR6&nbsp;được x&acirc;y dựng tr&ecirc;n&nbsp;tiến tr&igrave;nh&nbsp;6nm của TSMC với kiến tr&uacute;c đồ họa Xe HPG&nbsp;hỗ trợ&nbsp;khả năng Ray Tracing mạnh mẽ để n&acirc;ng cao trải nghiệm chơi game v&agrave; s&aacute;ng tạo của bạn.</li>\r\n</ul>\r\n', 1, '1723997569_1723997524_name (28).jpg', 0, 0, 7, '2023-02-17', 0),
(7, 'MÁY BỘ ROSA', '<p>Với 8GB Ram 3200MHz, v&agrave; AMD Ryzen 3 PRO 4350G mạnh mẽ m&aacute;y bạn đ&atilde; đ&aacute;p ứng hầu hết c&aacute;c nhu cầu văn ph&ograve;ng v&agrave; khả năng giải tr&iacute; với c&aacute;c tựa game như LMHT&nbsp;</p>\r\n', '\r\nCPU AMD Ryzen 5 5500GT\r\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>CPU AMD Ryzen 3 PRO 4350G</strong>\r\n			<p><strong>CPU AMD Ryzen 3 PRO 4350G</strong>&nbsp;l&agrave; d&ograve;ng APU phổ th&ocirc;ng mới nhất của AMD dựa tr&ecirc;n kiến tr&uacute;c Zen 3. CPU n&agrave;y c&oacute; nh&acirc;n đồ họa t&iacute;ch hợp Radeon c&oacute; khả năng chơi tốt nhiều tựa game ở mức thiết lập cơ bản.</p>\r\n\r\n			<p>.</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>\r\n			<h3>Kiến Tr&uacute;c &#39;&#39;Zen 3&#39;&#39;&nbsp;</h3>\r\n\r\n			<p>&quot;Zen 3&quot; được cải tiến lại về thiết kế để mang đến hiệu suất tối ưu so với c&aacute;c thế hệ &#39;&#39; Zen &#39;&#39; trước, thể hiện sự tập trung kh&ocirc;ng ngừng của AMD v&agrave;o hiệu suất xử l&yacute; đơn nh&acirc;n, tiết kiệm năng lượng v&agrave; giảm độ trễ.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Hiệu suất bộ nhớ</strong>\r\n\r\n			<p><strong>&nbsp;ROSA A4350G&nbsp;</strong>trang bị bộ nhớ 8GB Bus 3200&nbsp;U-DIMM với t&ugrave;y chọn n&acirc;ng cấp tối đa l&ecirc;n 64GB cung cấp hiệu suất tốt nhất để cho ra h&igrave;nh ảnh 3D tuyệt vời.</p