(18, 'Bộ máy AI| Chính hãng VN/A', '<p>Với 8GB Ram 3200MHz, v&agrave; AMD Ryzen 3 PRO 4350G mạnh mẽ m&aacute;y bạn đ&atilde; đ&aacute;p ứng hầu hết c&aacute;c nhu cầu văn ph&ograve;ng v&agrave; khả năng giải tr&iacute; với c&aacute;c tựa game như LMHT&nbsp;Với 8GB Ram 3200MHz, v&agrave; AMD Ryzen 3 PRO 4350G mạnh mẽ m&aacute;y bạn đ&atilde; đ&aacute;p ứng hầu hết c&aacute;c nhu cầu văn ph&ograve;ng v&agrave; khả năng giải tr&iacute; với c&aacute;c tựa game như LMHT&nbsp;</p>\r\n', '\r\nCPU AMD Ryzen 5 5500GT\r\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>CPU AMD Ryzen 3 PRO 4350G</strong>\r\n			<p><strong>CPU AMD Ryzen 3 PRO 4350G</strong>&nbsp;l&agrave; d&ograve;ng APU phổ th&ocirc;ng mới nhất của AMD dựa tr&ecirc;n kiến tr&uacute;c Zen 3. CPU n&agrave;y c&oacute; nh&acirc;n đồ họa t&iacute;ch hợp Radeon c&oacute; khả năng chơi tốt nhiều tựa game ở mức thiết lập cơ bản.</p>\r\n\r\n			<p>.</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>\r\n			<h3>Kiến Tr&uacute;c &#39;&#39;Zen 3&#39;&#39;&nbsp;</h3>\r\n\r\n			<p>&quot;Zen 3&quot; được cải tiến lại về thiết kế để mang đến hiệu suất tối ưu so với c&aacute;c thế hệ &#39;&#39; Zen &#39;&#39; trước, thể hiện sự tập trung kh&ocirc;ng ngừng của AMD v&agrave;o hiệu suất xử l&yacute; đơn nh&acirc;n, tiết kiệm năng lượng v&agrave; giảm độ trễ.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Hiệu suất bộ 