(22, 'BỘ MÁY GAMING', '<p>Case&nbsp;m&aacute;y t&iacute;nh&nbsp;Corsair&nbsp;275R Airflow Tempered Glass Mid-Tower&nbsp;Gaming&nbsp;được sản xuất bởi&nbsp;<strong>Corsair</strong>&nbsp;-&nbsp;1 c&ocirc;ng ty tại Mỹ chuy&ecirc;n thiết kế, sản xuất c&aacute;c&nbsp;b&agrave;n ph&iacute;m,&nbsp;chuột,&nbsp;tai nghe&nbsp;v&agrave;&nbsp;ghế&nbsp;gaming, đang được ưa chuộng bởi c&aacute;c game thủ Việt hiện nay do thiết kế hiện đại, bắt mắt với gi&aacute; th&agrave;nh hợp l&yacute;.</p>\r\n\r\n<p><img alt=\"\" src=\"https://longbinh.com.vn/images/companies/1/11-2019/Thung_mayPC/CASE_COR-275RB/CASE_COR-275RB_LONGBINH.jpg1.jpg?1572665413676\" /></p>\r\n\r\n<p><strong>Thiết kế c&aacute; t&iacute;nh</strong></p>\r\n\r\n<p>Case&nbsp;Corsair&nbsp;275R Airflow Tempered Glass Mid-Tower&nbsp;Gaming&nbsp;được thiết kế hầm hố với những đường v&acirc;n mặt ph&iacute;a trước c&oacute; thể nh&igrave;n b&ecirc;n trong v&agrave; mặt lưới ph&iacute;a tr&ecirc;n nhằm&nbsp;tản nhiệt. Ngo&agrave;i ra ph&iacute;a b&ecirc;n cạnh của case c&ograve;n được l&agrave;m mặt k&iacute;nh gi&uacute;p bạn c&oacute; thể nh&igrave;n r&otilde; ph&iacute;a trong.</p>\r\n\r\n<p><img alt=\"\" src=\"https://longbinh.com.vn/images/companies/1/11-2019/Thung_mayPC/CASE_COR-275RB/CASE_COR-275RB_LONGBINH.jpg3.jpg?1572665478402\" /></p>\r\n\r\n<p><strong>Đầy đủ c&aacute;c cổng kết nối</strong></p>\r\n\r\n<p>Hỗ trợ dạng&nbsp;mainboard&nbsp;Mini-ITX,&nbsp;Micro-ATX,&nbsp;ATX&nbsp;&ndash; th&ocirc;ng tin người d&ugrave;ng cần lưu &yacute; để tr&aacute;nh gặp phải trường hợp nhầm lẫn khi mua dẫn đến main kh&ocirc;ng hợp với case. B&ecirc;n canh đ&oacute; hỗ trợ th&ecirc;m c&aacute;c khay mở rộng với c&aacute;c k&iacute;ch thước kh&aacute;c nhau gi&uacute;p người d&ugrave;ng c&oacute; nhiều lựa chọn hơn. 2 khay 3.5&rdquo; v&agrave; 4 khay d&agrave;nh cho 2.5&rdquo;.</p>\r\n\r\n<p><img alt=\"\" src=\"https://longbinh.com.vn/images/companies/1/11-2019/Thung_mayPC/CASE_COR-275RB/CASE_COR-275RB_LONGBINH.jpg4.jpg?1572665499604\" /></p>\r\n\r\n<p>2 cổng giao tiếp chuẩn&nbsp;USB&nbsp;3.0 được nh&agrave; sản xuất hỗ trợ th&ecirc;m mang lại cho người d&ugrave;ng trải nghiệm tốt hơn về tốc độ cũng như tăng th&ecirc;m phần phong ph&uacute; với kết nối nhiều&nbsp;phụ kiện&nbsp;hơn. Ngo&agrave;i ra, người d&ugrave;ng c&oacute; thể sử dụng 2 cổng n&agrave;y 1 c&aacute;ch đơn giản ở ngay ph&iacute;a trước chứ kh&ocirc;ng cần m&ograve; c&aacute;c cổng&nbsp;USB&nbsp;kh&aacute;c ở đằng sau. Với tổ hợp tất cả c&aacute;c cổng kết nối ph&iacute;a trước được gắn ở tr&ecirc;n mang lại cảm gi&aacute;c thuận tiện cũng như kh&ocirc;ng l&agrave;m mất thẩm mĩ tới vẻ đẹp &ldquo;g&oacute;c cạnh, sắc n&eacute;t&rdquo; của&nbsp;Case&nbsp;Corsair&nbsp;275R Airflow Tempered Glass Mid-Tower&nbsp;Gaming.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"eJOY__extension_root_class\" id=\"eJOY__extension_root\" style=\"all:unset\">&nbsp;</div>\r\n', '\nCPU AMD Ryzen 5 5500GT\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<ul>\r\n	<li>Loại case: Mid Tower</li>\r\n	<li>Hỗ trợ mainboard: ATX, Micro-ATX, Mini-ITX</li>\r\n	<li>Số lượng ổ đĩa hỗ trợ: 2 x 3.5&quot; , 4 x 2.5&quot;</li>\r\n	<li>Cổng k&ecirc;́t n&ocirc;́i: 2 x USB 3.0</li>\r\n	<li>Hỗ trợ tản nhiệt CPU cao: 170 mm</li>\r\n	<li>K&iacute;ch thước radiator tối đa: 360 mm</li>\r\n	<li>Loại quạt hỗ trợ mặt trước: 3 x 120 mm, 2 x 140 mm</li>\r\n	<li>Loại quạt hỗ trợ ph&iacute;a tr&ecirc;n: 2 x 120 mm, 2 x 140 mm</li>\r\n	<li>Loại quạt hỗ trợ ph&iacute;a sau: 1 x 120 mm</li>\r\n	<li>S&ocirc;́ lượng quạt tặng kèm: 3 x 120 mm</li>\r\n	<li>S&ocirc;́ slot PCI: 7+2</li>\r\n</ul>\r\n\r\n<div class=\"eJOY__extension_root_class\" id=\"eJOY__extension_root\" style=\"all:unset\">&nbsp;</div>\r\n', 1, '1724003003_1723996357_name (18).png', 0, 0, 5, '2023-02-12', 0),
