(47, 'VGA-ASUS ROG-STRIX-RTX3090-O24G-GAMING', '<ul>\r\n	<li>Card m&agrave;n h&igrave;nh Asus ROG STRIX RTX3090-O24G-GAMING l&agrave; một trong những sản phẩm cao cấp nhất của Asus phục vụ cho nhu cầu gaming ở độ ph&acirc;n giải 4K 60Fps. Đ&acirc;y l&agrave; card đồ họa sử dụng kiến tr&uacute;c Ampare ho&agrave;n to&agrave;n mới c&ugrave;ng nh&acirc;n RT thế hệ 2, nh&acirc;n Tensor thế hệ 3, Nvidia RTX IO, VRAM GDDR6X v&agrave; sản xuất tr&ecirc;n tiến tr&igrave;nh 8nm được Samsung l&agrave;m ri&ecirc;ng.</li>\r\n</ul>\r\n', '\nCPU AMD Ryzen 5 5500GT\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<h3><strong>Đổi mới to&agrave;n diện&nbsp;</strong></h3>\r\n\r\n<p>Từ tr&ecirc;n xuống dưới, Card m&agrave;n h&igrave;nh Asus ROG STRIX RTX3090-O24G-GAMING đ&atilde; được cải tiến ho&agrave;n to&agrave;n để ph&ugrave; hợp với nền tảng Ampere ho&agrave;n to&agrave;n mới từ NVIDIA để mang đến&nbsp; hiệu suất chơi game vượt trội so với thế hệ trước. D&ograve;ng card đồ họa Strix mang một thiết kế mới v&agrave; nhiều kim loại hơn bao quanh 3 quạt l&agrave;m m&aacute;t với c&ocirc;ng nghệ Axial. C&aacute;ch bố tr&iacute; tất cả c&aacute;c quạt xoay c&ugrave;ng 1 hướng đ&atilde; lỗi thời, ở thế hệ mới nhất 3 quạt tr&ecirc;n d&ograve;ng card đồ họa ROG Strix được ph&acirc;n l&agrave;m 2 nhiệm vụ quạt ch&iacute;nh v&agrave; phụ trợ quay đảo chiều nhau đem lại hiệu suất tốt hơn hẳn. B&ecirc;n dưới c&aacute;c c&aacute;nh quạt, một bộ tản nhiệt lớn hơn, ấn tượng hơn đ&atilde; sẵn s&agrave;ng cho c&aacute;c mức nhiệt độ &quot;khủng&quot; nhất.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Quạt l&agrave;m m&aacute;t c&ocirc;ng nghệ Axial</strong></h3>\r\n\r\n<p>C&ocirc;ng nghệ Axial gi&uacute;p bố tr&iacute; quạt l&agrave;m m&aacute;t tối ưu hơn cho c&aacute;c bộ tản nhiệt k&iacute;ch thước lớn. Số lượng c&aacute;nh quạt cũng được tăng l&ecirc;n với 13 cho quạt trung t&acirc;m v&agrave; 11 cho 2 quạt c&ograve;n lại. Phần v&ograve;ng chắn của 2 quạt b&ecirc;n được thiết kế dạng răng cưa mỏng cho ph&eacute;p lấy được th&ecirc;m lượng gi&oacute; từ hai b&ecirc;n, trong khi đ&oacute; quạt trung t&acirc;m với k&iacute;ch thước lớn hơn phụ tr&aacute;ch nhiệm vụ gia tăng &aacute;p lực của gi&oacute; xuống bộ tản nhiệt kim loại.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>C&aacute;c c&aacute;nh quạt quay đảo chiều&nbsp;</strong></h3>\r\n\r\n<p>Thay v&igrave; cả 3 quạt đều vận h&agrave;nh theo chiều kim đồng hồ như truyền thống, giờ đ&acirc;y quạt trung t&acirc;m sẽ quay ngược chiều so với 2 quạt c&ograve;n lại để đảm bảo to&agrave;n bộ phần heatsink sẽ được l&agrave;m m&aacute;t đều, qua đ&oacute; tăng được hiệu quả l&agrave;m m&aacute;t tổng thể cho to&agrave;n bộ VGA.&nbsp;</p>\r\n\r\n<p><img alt=\"Card màn hình Asus ROG-STRIX-RTX3090-24G-GAMING\" src=\"https://www.hanoicomputer.vn/media/lib/07-09-2020/asusrtx3070strix8gb.gif\" style=\"width:100%\" /></p>\r\n\r\n<p>C&ocirc;ng nghệ của Asus c&ograve;n cho ph&eacute;p c&aacute;c c&aacute;nh quạt tự ngừng quay khi nhiệt độ của VGA được giữ ở dưới mức 55 độ C, mục đ&iacute;ch vừa giảm được tiếng ồn, vừa giữ được hiệu năng l&agrave;m m&aacute;t tối đa.&nbsp;</p>\r\n\r\n<h3><strong>Bề mặt tiếp x&uacute;c ho&agrave;n thiện đỉnh cao ở mức độ vi m&ocirc;</strong></h3>\r\n\r\n<p>Để dẫn nhiệt hiệu quả hơn, phần tiếp x&uacute;c giữa GPU v&agrave; heatsink được l&agrave;m si&ecirc;u mịn để gia tăng từng nanomet tiếp x&uacute;c qua đ&oacute; gi&uacute;p truyền dẫn nhiệt hiệu quả.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Gia tăng k&iacute;ch thước tản nhiệt</strong></h3>\r\n\r\n<p>Bộ heatsink tr&ecirc;n card đồ họa thế hệ mới của Asus d&agrave;y đến 2,9 slot PCI. Việc tăng k&iacute;ch thước tản nhiệt so với thế hệ trước cung cấp nhiều kh&ocirc;ng gian tản nhiệt hơn gi&uacute;p chipset hoạt động ở mức hiệu năng cao hơn.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Linh kiện cao cấp</strong></h3>\r\n\r\n<p>To&agrave;n bộ linh kiện tr&ecirc;n c&aacute;c d&ograve;ng sản phẩm cao cấp của Asus đều được sử dụng linh kiện c&oacute; sự chọn lọc kỹ c&agrave;ng ở cả kh&iacute;a cạnh hiệu năng lẫn độ bền.&nbsp;</p>\r\n\r\n<p><img alt=\"Card màn hình Asus ROG-STRIX-RTX3090-24G-GAMING\" src=\"https://www.hanoicomputer.vn/media/lib/07-09-2020/img_components.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>T&iacute;ch hợp đ&egrave;n LED RGB bắt mắt c&oacute; thể t&ugrave;y chỉnh</strong></h3>\r\n\r\n<p>Phần th&acirc;n của VGA giờ đ&acirc;y được t&iacute;ch hợp dải đ&egrave;n LED bắt mắt v&agrave; tinh tế. Chủ nh&acirc;n của mỗi chiếc VGA c&oacute; thể t&ugrave;y &yacute; s&aacute;ng tạo với phần mềm Armoury Crate.&nbsp;</p>\r\n\r\n<p><img alt=\"Card màn hình Asus ROG-STRIX-RTX3090-24G-GAMING\" src=\"https://www.hanoicomputer.vn/media/lib/07-09-2020/asusrtx3070strix8gb-4.gif\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Bứt ph&aacute; hiệu năng dễ d&agrave;ng với GPU Tweak&nbsp;</strong></h3>\r\n\r\n<p>Tiện &iacute;ch ASUS GPU Tweak II đưa việc điều chỉnh cạc đồ họa l&ecirc;n một tầm cao mới. N&oacute; cho ph&eacute;p bạn điều chỉnh c&aacute;c th&ocirc;ng số quan trọng bao gồm tốc độ của GPU, bộ nhớ v&agrave; c&agrave;i đặt điện &aacute;p, với t&ugrave;y chọn gi&aacute;m s&aacute;t mọi th&agrave;nh phần trong thời gian thực. Điều khiển quạt n&acirc;ng cao cũng được t&iacute;ch hợp với nhiều t&iacute;nh năng kh&aacute;c để gi&uacute;p bạn tận dụng tối đa card đồ họa của m&igrave;nh.<img alt=\"Card màn hình Asus ROG-STRIX-RTX3090-24G-GAMING\" src=\"https://www.hanoicomputer.vn/media/lib/07-09-2020/img_gpu-tweak2x.png\" style=\"width:100%\" /></p>\r\n', 0, '1723997431_name (35).jpg', 0, 0, 10, '2023-03-29', 0);
