(48, 'MÁY BỘ ROSA R12100', '<ul>\r\n	<li>Với 8GB Ram 3200MHz, v&agrave; vi xử l&yacute; I3-12100 mạnh mẽ m&aacute;y bạn đ&atilde; đ&aacute;p ứng hầu hết c&aacute;c nhu cầu văn ph&ograve;ng v&agrave; khả năng giải tr&iacute; với c&aacute;c tựa game như LMHT c&ugrave;ng một số game online kh&aacute;c.</li>\r\n</ul>\r\n', '\nCPU AMD Ryzen 5 5500GT\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p><strong>PU Intel Core i3-12100</strong></p>\r\n\r\n			<p><strong>CPU Intel Core i3-12100</strong>&nbsp;l&agrave; CPU thế hệ thứ 12 của Intel (Alder Lake) tr&ecirc;n nền Socket LGA 1700 với kiến tr&uacute;c ho&agrave;n to&agrave;n mới cho hiệu năng vượt trội so với người tiền nhiệm.</p>\r\n			</td>\r\n			<td><img alt=\"VIET SON JSC\" src=\"https://i0.wp.com/bizweb.dktcdn.net/100/329/122/files/123552.jpg?w=1020&amp;ssl=1\" style=\"height:175px; width:307px\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"VIET SON JSC\" src=\"https://i0.wp.com/rosacomputer.com/wp-content/uploads/2023/07/Intel_Ice.jpg?resize=300%2C169&amp;ssl=1\" style=\"height:169px; width:300px\" /></td>\r\n			<td><strong>Intel &nbsp;UHD Graphics&nbsp;</strong>\r\n			<p>Intel UHD Graphics l&agrave; card đồ họa onboard phi&ecirc;n bản n&acirc;ng cấp của d&ograve;ng HD Graphics, card UHD Graphics c&oacute; khả năng hỗ trợ nội dung độ ph&acirc;n giải đến&nbsp;4K&nbsp;m&agrave; kh&ocirc;ng cần card m&agrave;n h&igrave;nh rời.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Hiệu suất bộ nhớ&nbsp;</strong>\r\n\r\n			<p><strong>Rosa&nbsp;</strong>I12100&nbsp;trang bị bộ nhớ 8GB Bus 3200&nbsp;U-DIMM với t&ugrave;y chọn n&acirc;ng cấp tối đa l&ecirc;n 64GB cung cấp hiệu suất tốt nhất để cho ra h&igrave;nh ảnh 3D tuyệt vời.</p>\r\n			</td>\r\n			<td><img alt=\"VIET SON JSC\" src=\"https://i0.wp.com/rosacomputer.com/wp-content/uploads/2023/07/a300-insanememoryperformance-mobile.webp?resize=300%2C247&amp;ssl=1\" style=\"height:247px; width:300px\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><strong>Tối ưu h&oacute;a khả năng&nbsp;&nbsp;</strong>\r\n			<p>Với 8GB Ram 3200MHz, v&agrave; vi xử l&yacute; I3-12100&nbsp;mạnh mẽ m&aacute;y bạn đ&atilde; đ&aacute;p ứng hầu hết c&aacute;c nhu cầu văn ph&ograve;ng v&agrave; khả năng giải tr&iacute; với c&aacute;c tựa game như LMHT c&ugrave;ng một số game online&nbsp;kh&aacute;c.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, '1724041140_name.jpg', 0, 0, 1, '2023-03-28', 0),
(49, 'MB-ASROCK H510M-HDV/M.2 SE', '<ul>\r\n	<li>Mainboard Asrock H510M-HDV/M.2 SE c&oacute; k&iacute;ch thước M-ATX 23.1 cm x 19.8 cm ph&ugrave; hợp với nhiều vỏ case m&aacute;y t&iacute;nh lớn nhỏ kh&aacute;c nhau. Thuộc ph&acirc;n kh&uacute;c bo mạch chủ phổ th&ocirc;ng n&ecirc;n c&aacute;ch bố tr&iacute; tr&ecirc;n phần mạch ở mức kh&aacute; cơ bản tuy nhi&ecirc;n kết cấu lại kh&aacute; chắc chắn với mật độ sợi thủy tinh PCB d&agrave;y đặc. Lớp mạch ngo&agrave;i được ph&ugrave; m&agrave;u đen h&agrave;i h&ograve;a thẩm mỹ. C&oacute; thể n&oacute;i rằng đ&acirc;y ch&iacute;nh l&agrave; bo mạch chủ ph&ugrave; hợp cho c&aacute;c bộ PC Gaming gi&aacute; rẻ hoặc c&aacute;c bộ PC văn ph&ograve;ng.</li>\r\n</ul>\r\n', '\nCPU AMD Ryzen 5 5500GT\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<p><strong>Thiết kế phổ th&ocirc;ng ph&ugrave; hợp nhiều cấu h&igrave;nh</strong></p>\r\n\r\n<p><strong><img alt=\"VIET SON JSC\" src=\"https://anphat.com.vn/media/lib/04-08-2023/mainboardasrockh510m-hdvm2se2.jpg\" /></strong></p>\r\n\r\n<p><strong>Mainboard Asrock H510M-HDV/M.2 SE</strong>&nbsp;c&oacute; k&iacute;ch thước M-ATX&nbsp;23.1 cm x 19.8 cm ph&ugrave; hợp với nhiều vỏ case m&aacute;y t&iacute;nh lớn nhỏ kh&aacute;c nhau. Thuộc ph&acirc;n kh&uacute;c bo mạch chủ phổ th&ocirc;ng n&ecirc;n c&aacute;ch bố tr&iacute; tr&ecirc;n phần mạch ở mức kh&aacute; cơ bản tuy nhi&ecirc;n kết cấu lại kh&aacute; chắc chắn với mật độ sợi thủy tinh PCB d&agrave;y đặc. Lớp mạch ngo&agrave;i được ph&ugrave; m&agrave;u đen h&agrave;i h&ograve;a thẩm mỹ. C&oacute; thể n&oacute;i rằng đ&acirc;y ch&iacute;nh l&agrave; bo mạch chủ ph&ugrave; hợp cho c&aacute;c bộ&nbsp;PC Gaming&nbsp;gi&aacute; rẻ hoặc c&aacute;c bộ&nbsp;PC văn ph&ograve;ng.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Đ&aacute;p ứng nhu cầu lưu trữ tốc độ cao</strong></p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://anphat.com.vn/media/lib/04-08-2023/mainboardasrockh510m-hdvm2se1.jpg\" /></p>\r\n\r\n<p>Khe cắm M.2 trang bị tr&ecirc;n&nbsp;<strong>Mainboard Asrock H510M-HDV/M.2 SE&nbsp;</strong>thuộc&nbsp;gen 3 c&oacute; tốc độ truyền dữ liệu l&ecirc;n tới 32Gb/s ph&ugrave; hợp với mọi ổ cứng&nbsp;SSD M.2 NVMe&nbsp;gen 3 v&agrave; gen 4 (tương th&iacute;ch ngược) tr&ecirc;n thị trường. Kh&ocirc;ng chỉ vậy, khe cắm n&agrave;y cũng tương th&iacute;ch với c&aacute;c ổ cứng M.2 SATA3 với tốc độ 6Gb/s.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Kết nối phổ th&ocirc;ng tương th&iacute;ch nhiều thiết bị ngoại vi</strong></p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://anphat.com.vn/media/lib/04-08-2023/mainboardasrockh510m-hdvm2se.jpg\" /></p>\r\n\r\n<p>Chiếc&nbsp;mainboard H510&nbsp;n&agrave;y sở hữu tới 3 loại cổng xuất h&igrave;nh phổ biến gồm&nbsp;D-Sub, DVI-D v&agrave; HDMI phục vụ tốt cho nhu cầu sử dụng l&ecirc;n tới 3 m&agrave;n h&igrave;nh. Số lượng cổng USB l&ecirc;n tới 12 cổng trong đ&oacute; c&oacute;&nbsp;6 x USB 3.2 Gen1 truyền tốc độ cao v&agrave;&nbsp;6 x USB 2.0 ph&ugrave; hợp cho c&aacute;c thiết bị chuột m&aacute;y t&iacute;nh, b&agrave;n ph&iacute;m, webcam, USB hay ổ cứng di động. Đặc biệt, nếu người d&ugrave;ng c&oacute; nhu cầu sử dụng c&aacute;c bộ&nbsp;tản nhiệt nước CPU&nbsp;tr&ecirc;n c&aacute;c bộ vi xử l&yacute; thế hệ 10 v&agrave; 11 m&agrave; bo mạch chủ n&agrave;y hỗ trợ ho&agrave;n to&agrave;n c&oacute; thể y&ecirc;n t&acirc;m khi sản phẩm n&agrave;y đ&atilde; c&oacute; sẵn 1 cổng cắm Pump Header.</p>\r\n', 1, '1723997214_name (4).png', 0, 0, 14, '2023-03-29', 1),
(50, 'CPU-I3-10105F-SRH8V', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td>H&atilde;ng&nbsp;</td>\r\n			<td>Intel</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Model</td>\r\n			<td>CPU-I3-10105F-SRH8V</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Số nh&acirc;n /luồng&nbsp;</td>\r\n			<td>&nbsp;4/8</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Base Clock</td>\r\n			<td>3.7 GHz</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Turbo Boost Clock&nbsp;</td>\r\n			<td>4.4 GHz</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cache&nbsp;</td>\r\n			<td>6MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tiến tr&igrave;nh sản xuất&nbsp;</td>\r\n			<td>14 nm</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Phi&ecirc;n bản PCI Express</td>\r\n			<td>4.0</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Số lane PCI Express</td>\r\n			<td>20</td>\r\n		</tr>\r\n		<tr>\r\n			<td>TDP</td>\r\n			<td>65W</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Hỗ trợ số k&ecirc;nh bộ nhớ</td>\r\n			<td>2</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Socket</td>\r\n			<td>LGA 1200</td>\r\n		</tr>\r\n		<tr>\r\n			<td>T&ecirc;n thế hệ</td>\r\n			<td>Rocket Lake</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Đồ họa t&iacute;ch hợp</td>\r\n			<td>Kh&ocirc;ng</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Si&ecirc;u ph&acirc;n luồng</td>\r\n			<td>C&oacute;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '\nCPU AMD Ryzen 5 5500GT\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<h3><strong>N&acirc;ng cấp của CPU Intel Core i3-10105F&nbsp;</strong></h3>\r\n\r\n<ul>\r\n	<li>Xung nhịp tăng nhẹ 0.1Ghz gi&uacute;p hiệu năng tăng l&ecirc;n trong khi gi&aacute; vẫn kh&ocirc;ng đổi so với thế hệ cũ</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>T&iacute;nh tương th&iacute;ch</strong></h3>\r\n\r\n<p>CPU Intel Core i3-10105F vẫn sử dụng socket LGA 1200 v&agrave; c&oacute; thể chạy được tr&ecirc;n c&aacute;c bo mạch chủ H410, B460, H470, Z490 v&agrave; c&aacute;c bo mạch chủ thế hệ mới H510, B560, Z590.&nbsp;</p>\r\n\r\n<h3><strong>Intel Core i3 d&agrave;nh cho ai?&nbsp;</strong></h3>\r\n\r\n<p>Với 4 nh&acirc;n 8 luồng v&agrave; hiệu năng tr&ecirc;n mỗi nh&acirc;n được n&acirc;ng cấp, Intel Core i3 sẽ ph&ugrave; hợp cho c&aacute;c bộ m&aacute;y gi&aacute; rẻ nhắm v&agrave;o mức hiệu năng tr&ecirc;n gi&aacute; th&agrave;nh, phục vụ mục đ&iacute;ch Gaming hoặc l&agrave;m việc với c&aacute;c phần mềm chuy&ecirc;n dụng.&nbsp;</p>\r\n', 1, '1723996652_name (27).jpg', 0, 0, 6, '2023-03-29', 0),
(51, ' CPU-I5-10400F-SRH3D / SRH79', '<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Ph&acirc;n kh&uacute;c CPU tầm trung sẽ chẳng c&ograve;n y&ecirc;n ả với sự xuất hiện của Intel Core i5-10400F, tiếp tục truyền thống l&agrave; chiếc i5 gi&aacute; rẻ nhất của 9400F hồi năm ngo&aacute;i</li>\r\n</ul>\r\n', '<p>Cấu h&igrave;nh Điện thoại Samsung Galaxy S20 FE (8GB/256GB)</p>\r\n<ul>\r\n	<li>\r\n	<p>M&agrave;n h&igrave;nh:</p>\r\n\r\n	<p>Super AMOLED6.5&quot;Full HD+</p>\r\n	</li>\r\n	<li>\r\n	<p>Hệ điều h&agrave;nh:</p>\r\n\r\n	<p>Android 12</p>\r\n	</li>\r\n	<li>\r\n	<p>Camera sau:</p>\r\n\r\n	<p>Ch&iacute;nh 12 MP &amp; Phụ 12 MP, 8 MP</p>\r\n	</li>\r\n	<li>\r\n	<p>Camera trước:</p>\r\n\r\n	<p>32 MP</p>\r\n	</li>\r\n	<li>\r\n	<p>Chip:</p>\r\n\r\n	<p>Snapdragon 865</p>\r\n	</li>\r\n	<li>\r\n	<p>RAM:</p>\r\n\r\n	<p>8 GB</p>\r\n	</li>\r\n	<li>\r\n	<p>Dung lượng lưu trữ:</p>\r\n\r\n	<p>256 GB</p>\r\n	</li>\r\n	<li>\r\n	<p>SIM:</p>\r\n\r\n	<p>2 Nano SIM (SIM 2 chung khe thẻ nhớ)Hỗ trợ 4G</p>\r\n	</li>\r\n	<li>\r\n	<p>Pin, Sạc:</p>\r\n\r\n	<p>4500 mAh25 W</p>\r\n	</li>\r\n</ul>\r\n', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td>H&atilde;ng&nbsp;</td>\r\n			<td>Intel</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Model</td>\r\n			<td>CPU-I5-10400F-SRH3D / SRH79</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Số nh&acirc;n /luồng&nbsp;</td>\r\n			<td>&nbsp;6/12</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Base Clock</td>\r\n			<td>2.9 GHz</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Turbo Boost Clock&nbsp;</td>\r\n			<td>4.3 GHz</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cache&nbsp;</td>\r\n			<td>12MB</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tiến tr&igrave;nh sản xuất&nbsp;</td>\r\n			<td>14 nm</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Phi&ecirc;n bản PCI Express</td>\r\n			<td>3.0</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Số lane PCI Express</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>TDP</td>\r\n			<td>65W</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Hỗ trợ số k&ecirc;nh bộ nhớ</td>\r\n			<td>2</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Socket</td>\r\n			<td>LGA 1200</td>\r\n		</tr>\r\n		<tr>\r\n			<td>T&ecirc;n thế hệ</td>\r\n			<td>Commet Lake</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Đồ họa t&iacute;ch hợp</td>\r\n			<td>Kh&ocirc;ng</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Si&ecirc;u ph&acirc;n luồng</td>\r\n			<td>C&oacute;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 1, '1723997080_name (27).jpg', 0, 0, 7, '2023-03-29', 0),
(52, 'CPU AMD Ryzen 9 7900X3D', '<ul>\r\n	<li>CPU AMD Ryzen 9 7900X3D l&agrave; mẫu CPU h&agrave;ng đầu của AMD Ryzen thời điểm hiện tại. Thuộc v&agrave;o thế hệ AMD Ryzen&trade; 7000 Series Desktop Processors, chiếc CPU AMD Ryzen n&agrave;y mang lại hiệu năng xử l&yacute; vượt trội cho bộ PC của bạn.</li>\r\n</ul>\r\n', '\nCPU AMD Ryzen 5 5500GT\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<p><strong>CPU AMD Ryzen 9 7900X3D</strong>&nbsp;l&agrave; mẫu&nbsp;CPU&nbsp;h&agrave;ng đầu của AMD Ryzen thời điểm hiện tại. Thuộc v&agrave;o thế hệ AMD Ryzen&trade; 7000 Series Desktop Processors, chiếc&nbsp;<strong>CPU AMD Ryzen</strong>&nbsp;n&agrave;y mang lại hiệu năng xử l&yacute; vượt trội cho bộ PC của bạn.</p>\r\n\r\n<h2><strong>Kiến tr&uacute;c Zen 4 hiện đại</strong></h2>\r\n\r\n<p>Kiến tr&uacute;c &quot;Zen 4&quot; được thiết kế để tận dụng tối đa băng th&ocirc;ng bổ sung m&agrave; bộ nhớ DDR5 mang lại v&agrave; đảm bảo hỗ trợ c&aacute;c thiết bị PCIe Gen 5 như SSD v&agrave; card đồ họa thế hệ tiếp theo. B&ecirc;n cạnh kết nối mới nhất, n&oacute; cũng giới thiệu hỗ trợ cho AVX-512 v&agrave; VNNI, gi&uacute;p n&oacute; c&oacute; khả năng tăng tốc truyền th&ocirc;ng AI, đưa n&oacute; ngang h&agrave;ng với Intel trong lĩnh vực n&agrave;y.</p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQzGIB05K0ZnkH47kM1k0zggI93h2KjcBNbd8fwgWwAo6sMdjln9BkyUlFaTywGNJquqM4&amp;usqp=CAU\" /></p>\r\n\r\n<h2><strong>C&ocirc;ng nghệ AMD 3D V-Cache&trade;&nbsp;</strong></h2>\r\n\r\n<p>Nằm trong AMD Ryzen 7000 Series,&nbsp;AMD Ryzen 9 7900X3D được sở hữu c&ocirc;ng nghệ 3D V-Cache.&nbsp;AMD kết hợp c&aacute;c bộ vi xử l&yacute; h&agrave;ng đầu của m&igrave;nh với bộ nhớ tr&ecirc;n chip l&ecirc;n tới 128MB&nbsp;cho lượng khung h&igrave;nh tr&ecirc;n gi&acirc;y khi chơi Game cực ấn tượng.</p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://anphat.com.vn/media/lib/13-03-2023/3d.png\" /></p>\r\n\r\n<h2><strong>Th&ocirc;ng số kỹ thuật</strong></h2>\r\n\r\n<p>CPU AMD Ryzen 9 7900X3D sử dụng Socket AM5, được trang bị 12 nh&acirc;n v&agrave; 24 luồng. Mức xung nhịp cơ bản của n&oacute; l&agrave; 4.4Ghz v&agrave; c&oacute; thể đạt tối đa l&ecirc;n tới 5.6Ghz mang tới tốc độ xử l&yacute; tuyệt vời gi&uacute;p bạn tối ưu hiệu quả l&agrave;m việc cũng như l&agrave; trải nghiệm những tựa Game y&ecirc;u th&iacute;ch một c&aacute;ch mượt m&agrave; nhất.</p>\r\n\r\n<p>Bộ nhớ Cache L2 12MB v&agrave; 128MB Cache L3 hỗ trợ&nbsp;tối ưu h&oacute;a khả năng l&agrave;m việc của CPU, đẩy hiệu suất xử l&yacute; l&ecirc;n tối đa.</p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://anphat.com.vn/media/product/44575_cpu_amd_ryzen_9_7900x3d_4_4_ghz__1_.jpg\" /></p>\r\n\r\n<p>AMD Ryzen 9 7900X3D ph&aacute; vỡ giới hạn về tốc độ đọc ghi dữ liệu cũng như những tốc độ kh&aacute;c nhờ v&agrave;o c&ocirc;ng nghệ&nbsp;PCIe 5.0. N&oacute; cũng được hỗ trợ RAM DDR5 hiện đại nhất thời điểm hiện tại. Đ&atilde; vậy tốc độ xử l&yacute; c&ograve;n được tăng tường nhờ v&agrave;o c&ocirc;ng nghệ AMD EXPO. AMD Extended Profiles for Overclocking (C&ocirc;ng nghệ AMD EXPO&trade;) được ph&aacute;t triển để cho ph&eacute;p hỗ trợ &eacute;p xung bộ nhớ th&acirc;n thiện với người d&ugrave;ng đối với tất cả c&aacute;c loại bộ nhớ, mang đến cho người d&ugrave;ng một lộ tr&igrave;nh dễ d&agrave;ng để tăng tốc sức mạnh nhằm đạt được bộ nhớ tăng tốc trong hệ thống của họ.</p>\r\n', 1, '1723996579_name (26).jpg', 0, 0, 19, '2023-03-29', 2),
(53, 'CPU AMD RYZEN THREADRIPPER 7960X', '<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>CPU AMD Ryzen Threadripper 7960X l&agrave; bộ xử l&yacute; d&agrave;nh cho m&aacute;y t&iacute;nh để b&agrave;n c&oacute; 24 l&otilde;i, ra mắt v&agrave;o giữa th&aacute;ng 10 năm 2023 vừa qua, với mức gi&aacute; khởi điểm tại Việt Nam tr&ecirc;n 40.000.000đ. Bộ vi xử l&yacute; l&agrave; một phần của d&ograve;ng AMD Threadripper, sử dụng kiến ​​tr&uacute;c Zen 4 (Storm Peak) với Socket sTR5. Nhờ AMD Simultaneous Multithreading (SMT), số lượng l&otilde;i được tăng gấp đ&ocirc;i một c&aacute;ch hiệu quả, l&ecirc;n 48 luồng.</li>\r\n</ul>\r\n\r\n<div class=\"eJOY__extension_root_class\" id=\"eJOY__extension_root\" style=\"all:unset\">&nbsp;</div>\r\n', '\nCPU AMD Ryzen 5 5500GT\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<p>CPU AMD Ryzen Threadripper 7960X&nbsp;l&agrave; bộ xử l&yacute; d&agrave;nh cho m&aacute;y t&iacute;nh để b&agrave;n c&oacute; 24 l&otilde;i, ra mắt v&agrave;o giữa th&aacute;ng 10 năm 2023 vừa qua, với mức gi&aacute; khởi điểm tại Việt Nam tr&ecirc;n 40.000.000đ. Bộ vi xử l&yacute; l&agrave; một phần của d&ograve;ng AMD Threadripper, sử dụng kiến ​​tr&uacute;c Zen 4 (Storm Peak) với Socket sTR5. Nhờ AMD Simultaneous Multithreading (SMT), số lượng l&otilde;i được tăng gấp đ&ocirc;i một c&aacute;ch hiệu quả, l&ecirc;n 48 luồng.</p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://nguyencongpc.vn/media/lib/23-11-2023/415625-threadripper-3990x-campag.jpg\" style=\"height:1px; width:1px\" /></p>\r\n\r\n<p>AMD Threadripper 7960X<a href=\"https://nguyencongpc.vn/cpu-amd-ryzen-threadrippe-7960x\">&nbsp;</a>c&oacute; 128 MB bộ đệm L3 v&agrave; hoạt động ở tốc độ 4,2 GHz theo mặc định, nhưng c&oacute; thể tăng tốc l&ecirc;n tới 5,3 GHz, t&ugrave;y thuộc v&agrave;o khối lượng c&ocirc;ng việc. AMD đang x&acirc;y dựng Ryzen Threadripper 7960X tr&ecirc;n quy tr&igrave;nh sản xuất 5 nm sử dụng 26,280 triệu b&oacute;ng b&aacute;n dẫn. Khu&ocirc;n silicon của chip kh&ocirc;ng được chế tạo tại AMD m&agrave; tại xưởng đ&uacute;c của TSMC. Bạn c&oacute; thể tự do điều chỉnh hệ số nh&acirc;n đ&atilde; mở kh&oacute;a tr&ecirc;n Ryzen Threadripper 7960X, điều n&agrave;y gi&uacute;p đơn giản h&oacute;a rất nhiều việc &eacute;p xung v&igrave; bạn c&oacute; thể dễ d&agrave;ng quay số ở bất kỳ tần số &eacute;p xung n&agrave;o.</p>\r\n\r\n<p>Với TDP 350 W, Ryzen Threadripper 7960X cực kỳ ngốn điện, điều đ&oacute; c&oacute; nghĩa l&agrave; bạn cần khả năng l&agrave;m m&aacute;t đỉnh cao. Bộ xử l&yacute; của AMD hỗ trợ bộ nhớ DDR5 với giao diện bốn k&ecirc;nh. Tốc độ bộ nhớ được hỗ trợ ch&iacute;nh thức cao nhất l&agrave; 5200 MT/s, nhưng với việc &eacute;p xung (v&agrave; c&aacute;c m&ocirc;-đun bộ nhớ ph&ugrave; hợp), bạn c&oacute; thể đạt được tốc độ cao hơn nữa. Bộ nhớ ECC cũng được hỗ trợ, đ&acirc;y l&agrave; một khả năng quan trọng đối với c&aacute;c hệ thống quan trọng nhằm tr&aacute;nh hỏng dữ liệu. Để giao tiếp với c&aacute;c linh kiện kh&aacute;c trong m&aacute;y, AMD Threadripper 7960X sử dụng kết nối PCI-Express Gen 5. Bộ xử l&yacute; n&agrave;y kh&ocirc;ng c&oacute; đồ họa t&iacute;ch hợp, bạn sẽ cần một card đồ họa ri&ecirc;ng.</p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://nguyencongpc.vn/media/lib/23-11-2023/00.png\" style=\"height:1px; width:1px\" /></p>\r\n\r\n<p>Ảo h&oacute;a phần cứng c&oacute; sẵn tr&ecirc;n Ryzen Threadripper 7960X, gi&uacute;p cải thiện đ&aacute;ng kể hiệu suất m&aacute;y ảo. C&aacute;c chương tr&igrave;nh sử dụng Tiện &iacute;ch mở rộng vectơ n&acirc;ng cao (AVX) sẽ chạy tr&ecirc;n bộ xử l&yacute; n&agrave;y, gi&uacute;p tăng hiệu suất cho c&aacute;c ứng dụng nặng về t&iacute;nh to&aacute;n. B&ecirc;n cạnh AVX, AMD cũng đ&atilde; bổ sung hỗ trợ cho c&aacute;c hướng dẫn AVX2 v&agrave; AVX-512 mới hơn. AMD Ryzen Threadripper 7960X sở hữu 24 nh&acirc;n v&agrave; 48 luồng gi&uacute;p cho l&agrave;m việc s&aacute;ng tạo nhanh như chớp. Với 4.2 GHz default, c&oacute; thể boost up l&ecirc;n 5.3 GHz, t&ugrave;y thuộc v&agrave;o nhu cầu sử dụng của bạn. Hỗ trợ 48 l&agrave;n PCIe<sup>&reg;</sup>&nbsp;gen 5 đ&aacute;p ứng mọi nhu cầu GPU v&agrave; NVMe mới nhất.</p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://nguyencongpc.vn/media/lib/23-11-2023/232302815_2023_threadripper7000s.jpg\" style=\"height:1px; width:1px\" /></p>\r\n\r\n<p>Bộ nhớ đệm L3 128MB gi&uacute;p truy cập nhanh ch&oacute;ng v&agrave;o c&aacute;c file data lớn. RAM 4 channels DDR5 hỗ trợ cả chuẩn ECC mang đến hiệu suất cao v&agrave; &iacute;t lỗi hơn, bộ xử l&yacute; n&agrave;y kh&ocirc;ng c&oacute; đồ họa t&iacute;ch hợp, v&agrave; điều đ&oacute; đồng nghĩa ch&uacute;ng ta phải cần một card đồ họa ri&ecirc;ng. Ứng dụng Advanced Vector Extensions (AVX) sử dụng cho c&aacute;c t&iacute;nh to&aacute;n nặng, ngo&agrave;i ra hỗ trợ th&ecirc;m AVX2 and AVX-512.</p>\r\n\r\n<p>Bộ vi xử l&yacute; m&aacute;y t&iacute;nh để b&agrave;n &nbsp;AMD Ryzen Threadripper 7960X với 64 l&otilde;i mạnh nhất thế giới l&agrave; bộ vi xử l&yacute; tối ưu cho m&aacute;y t&iacute;nh để b&agrave;n (PC).&nbsp;Bộ xử l&yacute; Ryzen&trade; Threadripper&trade; thế hệ thứ 3 sẽ hoạt động tr&ecirc;n bo mạch chủ AMD TRX40, nền tảng m&aacute;y t&iacute;nh để b&agrave;n cao cấp đầu ti&ecirc;n tr&ecirc;n thế giới đ&atilde; sẵn s&agrave;ng cho chuẩn PCIe&reg; 4.0 hiện đại. Nền tảng mạnh mẽ, c&oacute; thể mở rộng, cung cấp số lượng I/O lớn v&agrave; khả năng mở rộng nhiều nhất cho tương lai m&agrave; bạn c&oacute; thể nhận được tr&ecirc;n bộ xử l&yacute; m&aacute;y t&iacute;nh để b&agrave;n, d&agrave;nh cho c&aacute;c hệ thống đa GPU v&agrave; NVMe.</p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://nguyencongpc.vn/media/lib/23-11-2023/138886-ryzen-threadripper-mother.jpg\" style=\"height:1px; width:1px\" /></p>\r\n\r\n<p>AMD Ryzen Threadripper 7960X hỗ trợ RAM k&ecirc;nh bốn DDR4 chuẩn ECC, với hầu hết c&aacute;c k&ecirc;nh bộ nhớ bạn c&oacute; thể nhận được tr&ecirc;n m&aacute;y t&iacute;nh để b&agrave;n, bộ xử l&yacute; Ryzen&trade; Threadripper&trade; c&oacute; thể hỗ trợ Bộ nhớ M&aacute;y trạm DDR4 chuẩn ECC để giữ cho bạn lu&ocirc;n chặt chẽ, điều chỉnh v&agrave; đồng bộ ho&agrave;n hảo.</p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://nguyencongpc.vn/media/lib/23-11-2023/138886-threadripper-quad-channel.jpg\" style=\"height:1px; width:1px\" /></p>\r\n\r\n<p>Ngo&agrave;i ra, Chip xử l&yacute; AMD Ryzen Threadripper 7960X c&ograve;n hỗ Trợ NVMe RAID. Kết hợp tối đa s&aacute;u ổ cứng chuẩn NVMe để c&oacute; tốc độ si&ecirc;u việt hoặc khả năng backup vững chắc với bộ xử l&yacute; Ryzen&trade; Threadripper&trade;. Nhận gấp đ&ocirc;i băng th&ocirc;ng với chuẩn PCIe&reg; 4.0, d&agrave;nh ri&ecirc;ng cho m&aacute;y t&iacute;nh để b&agrave;n cao cấp tr&ecirc;n bo mạch chủ AMD TRX40.</p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://nguyencongpc.vn/media/lib/23-11-2023/312762-amd-threadripper-motherbo.jpg\" style=\"height:1px; width:1px\" /></p>\r\n\r\n<p>Bộ xử l&yacute; đặc biệt đến từ nh&agrave; AMD xứng đ&aacute;ng với tản nhiệt đặc biết nhất, khai th&aacute;c hết khả năng thiết bị của bạn với c&aacute;c giải ph&aacute;p tản nhiệt tuyệt vời d&agrave;nh cho bộ xử l&yacute; Ryzen&trade; Threadripper&trade; đến từ c&aacute;c đối t&aacute;c của AMD, bao gồm cả tản nhiệt Wraith Ripper Cooler.</p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://nguyencongpc.vn/media/lib/23-11-2023/138886-ryzen-wraith-ripper-1260x.jpg\" style=\"height:1px; width:1px\" /></p>\r\n\r\n<h2><strong>Điểm nổi bật từ&nbsp;CPU AMD Ryzen Threadripper 7960X đem lại:&nbsp;</strong></h2>\r\n\r\n<h3>Thổi B&ugrave;ng S&aacute;ng Tạo</h3>\r\n\r\n<p>Khi bạn đang l&agrave;m c&aacute;c dự &aacute;n modeling 3D phức tạp v&agrave; khai th&aacute;c tối đa c&aacute;c c&ocirc;ng cụ của phần mềm s&aacute;ng tạo để th&ecirc;m thắt &yacute; tưởng, chỉnh sửa hay l&agrave;m c&aacute;c animation hấp dẫn nhằm tạo n&ecirc;n sự ho&agrave;n thiện c&aacute;c t&aacute;c phẩm của bạn.</p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://nguyencongpc.vn/media/lib/23-11-2023/138886-3d-architecture-modeling.jpg\" style=\"height:1px; width:1px\" /></p>\r\n\r\n<h3>S&aacute;ng Tạo Kh&ocirc;ng Ngừng</h3>\r\n\r\n<p>Tổng hợp, chỉnh sửa v&agrave; tinh chỉnh c&aacute;c video chất lượng cao, hay xử l&yacute; mọi giai đoạn trong qu&aacute; tr&igrave;nh s&aacute;ng tạo của bạn, như: bao gồm VFX, modelling, chỉnh sửa,&hellip; một bộ xử l&yacute; đủ mạnh sẽ thực hiện mọi việc cho bạn.</p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://nguyencongpc.vn/media/lib/23-11-2023/138886-threadripper-video-progra.jpg\" style=\"height:1px; width:1px\" /></p>\r\n\r\n<h3>Render Thước Phim Từ Cuộc Sống</h3>\r\n\r\n<p>Cho d&ugrave; đ&oacute; l&agrave; c&aacute;c chi tiết nhỏ hoặc c&aacute;c bản thu &acirc;m gốc, bộ xử l&yacute; Ryzen&trade; Threadripper&trade; đủ khả năng tạo ra c&aacute;c t&aacute;c phẩm nghệ thuật ch&acirc;n thực v&agrave; mang thế giới kỹ thuật số trở n&ecirc;n sống động v&agrave; g&acirc;y được tiếng vang với kh&aacute;n giả.</p>\r\n\r\n<p><img alt=\"VIET SON JSC\" src=\"https://nguyencongpc.vn/media/lib/23-11-2023/138886-3d-modeling-live-city-sce.jpg\" style=\"height:1px; width:1px\" /></p>\r\n\r\n<h3>Game for Work hoặc Game for Play</h3>\r\n\r\n<p>Bộ xử l&yacute; Ryzen&trade; Threadripper&trade; đủ sức mạnh mang lại trải nghiệm chơi game mượt m&agrave; ngay khi m&aacute;y t&iacute;nh của bạn đang chạy song song c&aacute;c tr&igrave;nh bi&ecirc;n dịch hoặc render c&aacute;c tr&ograve; chơi m&agrave; bạn đang ph&aacute;t triển.</p>\r\n\r\n<div class=\"eJOY__extension_root_class\" id=\"eJOY__extension_root\" style=\"all:unset\">&nbsp;</div>\r\n', 1, '1723996525_name (26).jpg', 0, 0, 19, '2023-03-29', 0),
(54, 'MÁY BỘ ROSA G7400', '<ul>\r\n	<li>Với 8GB Ram 3200MHz, v&agrave; vi xử l&yacute; G7400 mạnh mẽ m&aacute;y bạn đ&atilde; đ&aacute;p ứng hầu hết c&aacute;c nhu cầu văn ph&ograve;ng v&agrave; khả năng giải tr&iacute; với c&aacute;c tựa game như LMHT c&ugrave;ng một số game online kh&aacute;c.</li>\r\n</ul>\r\n', '\nCPU AMD Ryzen 5 5500GT\nAMD Technologies - một trong những công ty nổi tiếng với sản phẩm CPU sẵn sàng cung cấp cho người dùng những khả năng xử lí và điện toán thông minh, nhanh nhạy nhất mọi thời đại. Trong lần chào sân mới này, CPU AMD Ryzen 5 5500GT (AMD AM4 - 6 Core - 12 Thread - Base 3.6Ghz - Turbo 4.4Ghz - Cache 19MB) đã tích hợp đầy đủ những yếu tố cần thiết cho một bộ vi xử lý CPU sẵn sàng giải quyết những tác vụ nặng. ', '<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n				<tbody>\r\n					<tr>\r\n						<td>CPU</td>\r\n						<td>CPU Intel Pentuim G7400 (2 Cores/4 Threads - 3.7GHz - 6MB Cache) - SK1700</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Mainboard</td>\r\n						<td>Mainboard - Intel H610 SK1700: 4 x DIMM DDR5, 2 x DIMM DDR4 23200/3000/2933/2800/2666MHz<br />\r\n						- 3 x PCIe 4.0/3.0 x16 slot; 1 x PCI slot<br />\r\n						- Graphics Output Options: 1 x D-Sub Port, 1 x DVI-D port, 1 xHDMI port, 1 x Display port<br />\r\n						- 4 SATA3; 1 x M.2 2280, 2260, 2242 (both SATA &amp; x4 PCIE mode)<br />\r\n						- 4 x USB 3.1 port(s) (2 Rear (included 1 Type C), 8 x USB 2.0 (2 x USB 2.0 Rear, Support 6 x USB 2.0 at midboard)<br />\r\n						- Realtek Gigabit LAN</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Ram&nbsp;</td>\r\n						<td>Ram Lexar 8GB bus 3200 DDR4 Udimm</td>\r\n					</tr>\r\n					<tr>\r\n						<td>SSD</td>\r\n						<td>Ổ cứng SSD Lexar 256GG M2 PCIe Gen3 - R: 3500MB/s - W: 1300MB/s</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Keyboard+Mouse</td>\r\n						<td>Mouse EMD14 (USB) - Keyboard EKD14 (USB)</td>\r\n					</tr>\r\n					<tr>\r\n						<td>Case</td>\r\n						<td>Emaster Case E661R</td>\r\n					</tr>\r\n					<tr>\r\n						<td>PSU</td>\r\n						<td>Jetek PSU 450Elite 450W</td>\r\n					</tr>\r\n					<tr>\r\n						<td>M&agrave;n h&igrave;nh&nbsp;</td>\r\n						<td>&nbsp;AOC 22B3HM/74 21.5&rdquo;/ FHD/ VA/ 75Hz/ Phẳng - Kết nối : 1xDsub (VGA) - 1x HDMI</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<h2>&nbsp;</h2>\r\n', 0, '1724041537_1724041060_name.jpg', 0, 0, 2, '2023-03-30', 2),
